(3, 4, '2018-10-30 18:22:42', 'Help Magento improve our product - take a brief survey ', 'We want your perspectives on Personalization and Experience Optimization. \n\nYour feedback is 100% confidential.\n\nExperience Optimization refers to A/B/n Testing, Recommendations, and Experience Targeting (dynamic content, emails, promotions, etc.)\n\nThank you!\n\nClick here\nhttps://www.surveymonkey.com/r/M2-Exp-Opt-Oct2018', 'https://www.surveymonkey.com/r/M2-Exp-Opt-Oct2018', 0, 0),
