(6, 4, '2018-11-27 20:30:21', 'Benefit from the Magento Ad Channels Early Access Program', 'Magento Ad Channels will simplify the set up and administration of Google Merchant Center and Google Ads, while also helping maximize Google Ads ROI to help you accelerate your business growth.\n \nAs an Early Access Program participant, you will gain:\n \n• Exclusive pre-release access to Magento Ad Channels\n• Feedback opportunities to impact features and capabilities\n \nIf you’re a Magento Open Source 2.2.2 or later user, please send an email to sales_channels@magento.com to participate.', 'https://magento.com/google-smart-shopping-campaigns-in-magento', 0, 0);

