(109, 'default', 0, 'porto_settings/custom_settings/custom_style', '.footer-bottom .logo img\r\n{display:none;}\r\n@media (min-width: 768px) {\r\n    .page-header.type1 .nav-sections {\r\n        margin-bottom: 0;\r\n    }\r\n}\r\n@media (min-width: 1200px) {\r\n    .footer-top, .footer-middle, .footer-bottom {\r\n        width: 1110px;\r\n        margin: 0 auto;\r\n    }\r\n}\r\n.footer .container {\r\n    max-width: 100%;\r\n    padding-left: 30px;\r\n    padding-right: 30px;\r\n}\r\n.page-main {\r\n    padding-top: 15px;\r\n    padding-bottom: 0;\r\n    margin-bottom: 13px;\r\n}\r\n.cms-index-index .page-main, .breadcrumbs + .page-main {\r\n    padding-top: 0;\r\n}\r\n.page-main > .columns {\r\n    padding-left: 15px;\r\n    padding-right: 15px;\r\n    padding-top: 15px;\r\n}\r\n.cms-index-index .page-main > .columns {\r\n    padding: 0;\r\n}\r\n.cms-index-index .page-main, .cms-index-index .page-main > .columns {\r\n    background-color: transparent;\r\n}\r\n.footer-middle .block.newsletter input {\r\n    border: 1px solid #ccc;\r\n    background-color: transparent;\r\n    height: 34px;\r\n}\r\n.footer-middle .block.newsletter .action.subscribe {\r\n    background-color: transparent;\r\n    color: #777;\r\n    height: 34px;\r\n    line-height: 34px;\r\n    border: 1px solid #ccc;\r\n}\r\n.product-item-photo {\r\n    padding: 0;\r\n}\r\n.checkout-index-index .page-main {\r\n    background: transparent;\r\n}\r\n.checkout-index-index .page-main .columns {\r\n    background-color: #fff;\r\n}\r\n@media (min-width: 768px) {\r\n    header.page-header.type1.sticky-header .nav-sections {\r\n        background-color: #08c;\r\n    }\r\n    header.page-header.type1.sticky-header .minicart-wrapper .action.showcart:before {\r\n        color: #fff;\r\n    }\r\n    .page-header.type1 .block-search .action.search {\r\n        height: 34px;\r\n        line-height: 34px;\r\n        width: 34px;\r\n        padding: 0;\r\n    }\r\n    .page-header.type1 .block-search input {\r\n        height: 34px;\r\n    }\r\n}\r\n@media (min-width: 1200px) {\r\n	header.page-header.sticky-header.type1 .nav-sections {\r\n		background-color: #08c;\r\n	}\r\n	header.page-header.sticky-header.type1 .minicart-wrapper .action.showcart .counter.qty {\r\n		color: #000;\r\n	}\r\n	header.page-header.sticky-header.type1 .minicart-wrapper .action.showcart:before {\r\n		color: #fff;\r\n	}\r\n}\r\n@media (min-width:1070px){\r\n	.container {max-width: 1054px}\r\n	.footer-top,.footer-middle,.footer-bottom{width:1024px}\r\n	.main.container {max-width:1024px}\r\n.navigation, .page-wrapper > .breadcrumbs, .page-header .header.panel, .header.content, .footer.content, .page-wrapper > .widget, .page-wrapper > .page-bottom, .block.category.event, .top-container, .page-main {max-width: 1054px}\r\n}'),
